import React from "react"


export default class Header extends React.Component {

    homeClicked() {

    }

    metricMaker() {

    }

    render() {


        return (
            <div id="headerBar">
                <h2>Metric Maker</h2>
                <div id="navBar">
                    <input type="button" value="Home" onClick={this.homeClicked}/>
                    <input type="button" value="Metric Maker" onClick={this.metricMaker}/>
                </div>
            </div>
        )
    }
}
